import React from "react"
import ReactDom from "react-dom"

function MyInfo(){
    return (
        <div>
        <h1>Harinath Amasa</h1>
        <p>I'm a full stack developer..!!!</p>
        <ul>
            <li>Java</li>
            <li>JavaScript</li>
            <li>TypeScript</li>
        </ul>
        </div>
    )
}

ReactDOM.render(<MyInfo/>,document.getElementById("root"));
